export interface Theme {
  body: string;
  text: string;
  toggleBorder: string;
  background: string;
  color: string;
  border: string
}

export const darkTheme: Theme = {
  body: '#FFF',
  text: '#363537',
  toggleBorder: '#FFF',
  background: '#363537',
  color: "white",
  border: "white"
}
export const lightTheme: Theme = {
  body: '#363537',
  text: '#FAFAFA',
  toggleBorder: '#6B8096',
  background: '#fff',
  color: "rgb(64, 63, 63)",
  border: "rgb(207, 205, 202)"
}
